pragma solidity ^0.8.4;

library Pairing {
  error InvalidProof();

  // The prime q in the base field F_q for G1
  uint256 constant BASE_MODULUS = 21888242871839275222246405745257275088696311157297823662689037894645226208583;

  // The prime moludus of the scalar field of G1.
  uint256 constant SCALAR_MODULUS = 21888242871839275222246405745257275088548364400416034343698204186575808495617;

  struct G1Point {
    uint256 X;
    uint256 Y;
  }

  // Encoding of field elements is: X[0] * z + X[1]
  struct G2Point {
    uint256[2] X;
    uint256[2] Y;
  }

  /// @return the generator of G1
  function P1() internal pure returns (G1Point memory) {
    return G1Point(1, 2);
  }

  /// @return the generator of G2
  function P2() internal pure returns (G2Point memory) {
    return
      G2Point(
        [
          11559732032986387107991004021392285783925812861821192530917403151452391805634,
          10857046999023057135944570762232829481370756359578518086990519993285655852781
        ],
        [
          4082367875863433681332203403145435568316851327593401208105741076214120093531,
          8495653923123431417604973247489272438418190587263600148770280649306958101930
        ]
      );
  }

  /// @return r the negation of p, i.e. p.addition(p.negate()) should be zero.
  function negate(G1Point memory p) internal pure returns (G1Point memory r) {
    if (p.X == 0 && p.Y == 0) return G1Point(0, 0);
    // Validate input or revert
    if (p.X >= BASE_MODULUS || p.Y >= BASE_MODULUS) revert InvalidProof();
    // We know p.Y > 0 and p.Y < BASE_MODULUS.
    return G1Point(p.X, BASE_MODULUS - p.Y);
  }

  /// @return r the sum of two points of G1
  function addition(G1Point memory p1, G1Point memory p2) internal view returns (G1Point memory r) {
    // By EIP-196 all input is validated to be less than the BASE_MODULUS and form points
    // on the curve.
    uint256[4] memory input;
    input[0] = p1.X;
    input[1] = p1.Y;
    input[2] = p2.X;
    input[3] = p2.Y;
    bool success;
    // solium-disable-next-line security/no-inline-assembly
    assembly {
      success := staticcall(sub(gas(), 2000), 6, input, 0xc0, r, 0x60)
    }
    if (!success) revert InvalidProof();
  }

  /// @return r the product of a point on G1 and a scalar, i.e.
  /// p == p.scalar_mul(1) and p.addition(p) == p.scalar_mul(2) for all points p.
  function scalar_mul(G1Point memory p, uint256 s) internal view returns (G1Point memory r) {
    // By EIP-196 the values p.X and p.Y are verified to less than the BASE_MODULUS and
    // form a valid point on the curve. But the scalar is not verified, so we do that explicitelly.
    if (s >= SCALAR_MODULUS) revert InvalidProof();
    uint256[3] memory input;
    input[0] = p.X;
    input[1] = p.Y;
    input[2] = s;
    bool success;
    // solium-disable-next-line security/no-inline-assembly
    assembly {
      success := staticcall(sub(gas(), 2000), 7, input, 0x80, r, 0x60)
    }
    if (!success) revert InvalidProof();
  }

  /// Asserts the pairing check
  /// e(p1[0], p2[0]) *  .... * e(p1[n], p2[n]) == 1
  /// For example pairing([P1(), P1().negate()], [P2(), P2()]) should succeed
  function pairingCheck(G1Point[] memory p1, G2Point[] memory p2) internal view {
    // By EIP-197 all input is verified to be less than the BASE_MODULUS and form elements in their
    // respective groups of the right order.
    if (p1.length != p2.length) revert InvalidProof();
    uint256 elements = p1.length;
    uint256 inputSize = elements * 6;
    uint256[] memory input = new uint256[](inputSize);
    for (uint256 i = 0; i < elements; i++) {
      input[i * 6 + 0] = p1[i].X;
      input[i * 6 + 1] = p1[i].Y;
      input[i * 6 + 2] = p2[i].X[0];
      input[i * 6 + 3] = p2[i].X[1];
      input[i * 6 + 4] = p2[i].Y[0];
      input[i * 6 + 5] = p2[i].Y[1];
    }
    uint256[1] memory out;
    bool success;
    // solium-disable-next-line security/no-inline-assembly
    assembly {
      success := staticcall(sub(gas(), 2000), 8, add(input, 0x20), mul(inputSize, 0x20), out, 0x20)
    }
    if (!success || out[0] != 1) revert InvalidProof();
  }
}

contract Verifier {
  using Pairing for *;

  struct VerifyingKey {
    Pairing.G1Point alfa1;
    Pairing.G2Point beta2;
    Pairing.G2Point gamma2;
    Pairing.G2Point delta2;
    Pairing.G1Point[] IC;
  }

  struct Proof {
    Pairing.G1Point A;
    Pairing.G2Point B;
    Pairing.G1Point C;
  }

  function verifyingKey() internal pure returns (VerifyingKey memory vk) {
    vk.alfa1 = Pairing.G1Point(
      20491192805390485299153009773594534940189261866228447918068658471970481763042,
      9383485363053290200918347156157836566562967994039712273449902621266178545958
    );

    vk.beta2 = Pairing.G2Point(
      [
        4252822878758300859123897981450591353533073413197771768651442665752259397132,
        6375614351688725206403948262868962793625744043794305715222011528459656738731
      ],
      [
        21847035105528745403288232691147584728191162732299865338377159692350059136679,
        10505242626370262277552901082094356697409835680220590971873171140371331206856
      ]
    );
    vk.gamma2 = Pairing.G2Point(
      [
        11559732032986387107991004021392285783925812861821192530917403151452391805634,
        10857046999023057135944570762232829481370756359578518086990519993285655852781
      ],
      [
        4082367875863433681332203403145435568316851327593401208105741076214120093531,
        8495653923123431417604973247489272438418190587263600148770280649306958101930
      ]
    );
    vk.delta2 = Pairing.G2Point(
      [
        12599857379517512478445603412764121041984228075771497593287716170335433683702,
        7912208710313447447762395792098481825752520616755888860068004689933335666613
      ],
      [
        11502426145685875357967720478366491326865907869902181704031346886834786027007,
        21679208693936337484429571887537508926366191105267550375038502782696042114705
      ]
    );
    vk.IC = new Pairing.G1Point[](5);

    vk.IC[0] = Pairing.G1Point(
      19918517214839406678907482305035208173510172567546071380302965459737278553528,
      7151186077716310064777520690144511885696297127165278362082219441732663131220
    );

    vk.IC[1] = Pairing.G1Point(
      690581125971423619528508316402701520070153774868732534279095503611995849608,
      21271996888576045810415843612869789314680408477068973024786458305950370465558
    );

    vk.IC[2] = Pairing.G1Point(
      16461282535702132833442937829027913110152135149151199860671943445720775371319,
      2814052162479976678403678512565563275428791320557060777323643795017729081887
    );

    vk.IC[3] = Pairing.G1Point(
      4319780315499060392574138782191013129592543766464046592208884866569377437627,
      13920930439395002698339449999482247728129484070642079851312682993555105218086
    );

    vk.IC[4] = Pairing.G1Point(
      3554830803181375418665292545416227334138838284686406179598687755626325482686,
      5951609174746846070367113593675211691311013364421437923470787371738135276998
    );
  }

  /// @dev Verifies a Semaphore proof. Reverts with InvalidProof if the proof is invalid.
  function verifyProof(
    uint256[2] memory a,
    uint256[2][2] memory b,
    uint256[2] memory c,
    uint256[4] memory input
  ) public view {
    // If the values are not in the correct range, the Pairing contract will revert.
    Proof memory proof;
    proof.A = Pairing.G1Point(a[0], a[1]);
    proof.B = Pairing.G2Point([b[0][0], b[0][1]], [b[1][0], b[1][1]]);
    proof.C = Pairing.G1Point(c[0], c[1]);

    VerifyingKey memory vk = verifyingKey();

    // Compute the linear combination vk_x of inputs times IC
    if (input.length + 1 != vk.IC.length) revert Pairing.InvalidProof();
    Pairing.G1Point memory vk_x = vk.IC[0];
    vk_x = Pairing.addition(vk_x, Pairing.scalar_mul(vk.IC[1], input[0]));
    vk_x = Pairing.addition(vk_x, Pairing.scalar_mul(vk.IC[2], input[1]));
    vk_x = Pairing.addition(vk_x, Pairing.scalar_mul(vk.IC[3], input[2]));
    vk_x = Pairing.addition(vk_x, Pairing.scalar_mul(vk.IC[4], input[3]));

    // Check pairing
    Pairing.G1Point[] memory p1 = new Pairing.G1Point[](4);
    Pairing.G2Point[] memory p2 = new Pairing.G2Point[](4);
    p1[0] = Pairing.negate(proof.A);
    p2[0] = proof.B;
    p1[1] = vk.alfa1;
    p2[1] = vk.beta2;
    p1[2] = vk_x;
    p2[2] = vk.gamma2;
    p1[3] = proof.C;
    p2[3] = vk.delta2;
    Pairing.pairingCheck(p1, p2);
  }
}

contracts/zkNews.sol.content:
//SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.7;

import "@appliedzkp/semaphore-contracts/interfaces/IVerifier.sol";
import "@appliedzkp/semaphore-contracts/base/SemaphoreCore.sol";
import "@appliedzkp/semaphore-contracts/base/SemaphoreGroups.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";


contract zkNews is SemaphoreCore, SemaphoreGroups, Ownable {


    // The external verifier used to verify Semaphore proofs.
    IVerifier public verifier;

    address public contractAddress = address(this);




    struct Post {
        bytes32 postId;
        uint256 hashCommitment;
        uint256 likes; 
        uint256 dislikes;
        uint256 balance; 
    }

     uint256[] public identityCommitments;

    mapping(bytes32 => Post) public posts; 


    event Registration(bytes32 signal);
    event NewPost(bytes32 postId);
    event PostLiked(bytes32 postId, uint256 likes);
    event PostDisliked(bytes32 postId, uint256 dislikes);
    event IdentityCommitment(uint256 indexed identityCommitment);
    event Withdrawal(bytes32 postId, uint256 balance);


    constructor(address _verifier) {
        verifier = IVerifier(_verifier);
    }

    function getIdentityCommitments() public view returns (uint256 [] memory) {
        return identityCommitments;
    }

    function getIdentityCommitment(uint256 _index) public view returns (uint256) {
        return identityCommitments[_index];
    }


    function insertIdentityAsClient(uint256 _leaf) public {
        identityCommitments.push(_leaf);
        emit IdentityCommitment(_leaf);
    }


    function register(
        bytes32 signal,
        uint256 root,
        uint256 nullifierHash,
        uint256 externalNullifier,
        uint256[8] calldata proof
    )
        external 
    {
        _verifyProof(
                signal,
                root,
                nullifierHash,
                externalNullifier,
                proof,
                verifier
            );

        _saveNullifierHash(nullifierHash);
        emit Registration(signal);
    }

    function postNews(
        bytes32 postId,
        uint hashCommitment
    )
        external
    {
        Post memory post = Post({postId: postId, hashCommitment:hashCommitment,likes: 0, dislikes: 0, balance:0});
        posts[postId] = post;  
        emit NewPost(postId);
    }

    function likePost(
        bytes32 postId,
        bytes32 signal,
        uint256 root,
        uint256 nullifierHash,
        uint256 externalNullifier,
        uint256[8] calldata proof
    )
        external
        returns (uint256)
    {
        _verifyProof(
                signal,
                root,
                nullifierHash,
                externalNullifier,
                proof,
                verifier
            );

        posts[postId].likes += 1;

        _saveNullifierHash(nullifierHash);

        emit PostLiked(postId, posts[postId].likes);
        return (posts[postId].likes);
    }

    function dislikePost(
        bytes32 postId,
        bytes32 signal,
        uint256 root,
        uint256 nullifierHash,
        uint256 externalNullifier,
        uint256[8] calldata proof
    )
        external
        returns (uint256)
    {
        _verifyProof(
                signal,
                root,
                nullifierHash,
                externalNullifier,
                proof,
                verifier
            );

        posts[postId].dislikes += 1;

        _saveNullifierHash(nullifierHash);

        emit PostDisliked(postId, posts[postId].dislikes);
        return (posts[postId].dislikes);
    }

    function getAllFunds() external view onlyOwner returns (uint256) {
        return address(this).balance;
    }

    function getPostFunds(bytes32 postId) external view returns (uint256) {
        return posts[postId].balance;
    }


    function withdrawFunds(bytes32 _postId, uint _amount, uint _hashCommitment) public {
        require(_amount <= posts[_postId].balance,"Not enough balance");
        require(_hashCommitment == posts[_postId].hashCommitment,"Your hashcommitment is wrong");
        payable(msg.sender).transfer(_amount);
         posts[_postId].balance -= _amount;
         emit Withdrawal(_postId, _amount);
    }

    function  fundPost( bytes32 postId ) payable public {
        posts[postId].balance += msg.value;
    }
}

